var AnnotationType = Java.type("com.lucidworks.apollo.common.models.nlp.AnnotationType");
var System = java.lang.System;
var ArrayList = Java.type("java.util.ArrayList");
var StringUtils = Java.type("org.apache.commons.lang3.StringUtils");

function(request, response, context, collection) {
  annotatedQuery = context.get("annotatedQuery");
  annotations = annotatedQuery.getAnnotationsByType(AnnotationType.PART_OF_SPEECH)
  System.out.println(annotations);

  nouns = new ArrayList();
  verbs = new ArrayList();

  for each(var a in annotations) {
    System.out.println(a.getAnnotatedText() + " - " + a.getLabel());
    if (a.getLabel().toLowerCase().startsWith("nn")) {
      nouns.add(a.getAnnotatedText());
    } else if (a.getLabel().toLowerCase().startsWith("vb")) {
      verbs.add(a.getAnnotatedText());
    }
  }

  System.out.println("nouns: " + nouns)
  System.out.println("verbs: " + verbs)

  request.putSingleParam("q_nouns", StringUtils.join(nouns, " "))
  request.putSingleParam("q_verbs", StringUtils.join(verbs, " "))
}

